import HeaderMenu from "./HeaderMenu/HeaderMenu"
import "./Header.css"

export default function Header() {
  return (
    <div className="HeaderChild">
        <HeaderMenu/>
        <a className="headerLogo">currency.com</a>
        <button className="headerLang" type="checkbox">dbhjb</button>
        <h1>Tokenised assets overview</h1>
    </div>
  )
}
